Now we need a getter in order to retrieve the field value, for this one we will be using the MethodDeclaration class: val getterDeclaration = MethodDeclaration.Builder.builder() .publicModifier() .type(Types.STRING) .name("getName") .body(MutableInstructions.create(listOf( returnValue(accessThisField(Types.STRING, "name")) ))) .build() And the full code is: val nameFieldDeclaration = FieldDeclaration.Builder.builder() .modifiers(KoresModifier.PRIVATE, KoresModifier.FINAL) .type(Types.STRING) .name("name") .build() val constructorDeclaration = ConstructorDeclaration.Builder.builder() .parameters( KoresParameter.Builder.builder() .type(Types.STRING) .name("name") .build() ) .body(MutableInstructions.create(listOf( setThisFieldValue(Types.STRING, "name", accessVariable(Types.STRING, "name")) ))) .build() val getterDeclaration = MethodDeclaration.Builder.builder() .publicModifier() .type(Types.STRING) .name("getName") .body(MutableInstructions.create(listOf( returnValue(accessThisField(Types.STRING, "name")) ))) .build() val personDeclaration = ClassDeclaration.Builder.builder() .name("Person") .fields(nameFieldDeclaration) .constructors(constructorDeclaration) .methods(getterDeclaration) .build() val sourceGenerator = PlainSourceGenerator()
val source = sourceGenerator.process(personDeclaration) println(source) And the result: public class Person { private final String name; public Person(String name) { this.name = name; } public String getName() { return this.name; }
}

11.body:
In this guide we have not used the BytecodeWriter yet, so let's try it: val nameFieldDeclaration = FieldDeclaration.Builder.builder() .modifiers(KoresModifier.PRIVATE, KoresModifier.FINAL) .type(Types.STRING) .name("name") .build() val constructorDeclaration = ConstructorDeclaration.Builder.builder() .parameters( KoresParameter.Builder.builder() .type(Types.STRING) .name("name") .build() ) .body(MutableInstructions.create(listOf( setThisFieldValue(Types.STRING, "name", accessVariable(Types.STRING, "name")) ))) .build() val getterDeclaration = MethodDeclaration.Builder.builder() .publicModifier() .type(Types.STRING) .name("getName") .body(MutableInstructions.create(listOf( returnValue(accessThisField(Types.STRING, "name")) ))) .build() val personDeclaration = ClassDeclaration.Builder.builder() .name("Person") .fields(nameFieldDeclaration) .constructors(constructorDeclaration) .methods(getterDeclaration) .build() val sourceGenerator = PlainSourceGenerator()
val source = sourceGenerator.process(personDeclaration) println(source) val bytecodeGenerator = BytecodeGenerator() // bytecodeClasses: Here we have a List<BytecodeClass>, every BytecodeClass stores its declaration // and the produced bytecode in the BytecodeClass.bytecode array.
// You can save those bytes and inspect them using bytecode inspection tools like
// Textifier, ASMifier, BytecodeDisassembler, javap or even a decompiler
// The disassembled version is available through BytecodeClass.disassembledCode as well, which uses
// the BytecodeDisassembler tool.
val bytecodeClasses = bytecodeGenerator.process(personDeclaration) // Create a ClassLoader using the current as a parent loader
// this loader has the utilities to load BytecodeClasses
val loader = CodeClassLoader()
// `define` receives the BytecodeClass list to load, but outputs only one defined class.
// It takes a List because the `process` outputs inner classes as well as anonymous classes,
// that should not be used directly.
// You can define classes individually by looping through every one and calling loader.define
val generatedClass = loader.define(bytecodeClasses)
// generatedClass: Here is the loaded class Let see if the class is working: val lookup = MethodHandles.publicLookup()
val constructor = lookup.findConstructor(generatedClass, MethodType.methodType(Void.TYPE, String::class.java))
val getName = lookup.findVirtual(generatedClass, "getName", MethodType.methodType(String::class.java))
val personInstance = constructor.invokeWithArguments("Foo")
val personName = getName.bindTo(personInstance).invokeExact() as String
println(personName) Outputs: Foo

