Kores uses GitHub packages to provide artifacts, and since Github does not support unauthenticated downloads yet , you will need to generate a Personal Access Token (PAT) with read:packages permission and configure it in gradle.properties inside $HOME/.gradle/gradle.properties: USERNAME=GITHUB_USERNAME
TOKEN=PAT Then configure the build.gradle to include Kores Repositories and dependecies: def GITHUB_USERNAME = project.findProperty("USERNAME") ?: System.getenv("USERNAME")
def GITHUB_PAT = project.findProperty("TOKEN") ?: System.getenv("TOKEN") repositories { mavenCentral() maven { url "https://maven.pkg.github.com/jonathanxd/jwiutils" credentials { username = GITHUB_USERNAME password = GITHUB_PAT } } maven { url "https://maven.pkg.github.com/jonathanxd/bytecodedisassembler" credentials { username = GITHUB_USERNAME password = GITHUB_PAT } } maven { url "https://maven.pkg.github.com/koresframework/kores" credentials { username = GITHUB_USERNAME password = GITHUB_PAT } } maven { url "https://maven.pkg.github.com/koresframework/kores-bytecodewriter" credentials { username = GITHUB_USERNAME password = GITHUB_PAT } } maven { url "https://maven.pkg.github.com/koresframework/kores-sourcewriter" credentials { username = GITHUB_USERNAME password = GITHUB_PAT } }
} dependencies { implementation("com.koresframework:kores:4.2.1.base") implementation("com.koresframework:kores-bytecodewriter:4.2.1.bytecode") implementation("com.koresframework:kores-sourcewriter:4.2.1.source")
} Kores team (that consists of only one member) is studying alternatives to artifact publication (jitpack is not an option until OpenJDK 17 support). At the moment, only Github packages is supported. Jitpack support was not entirely dropped, but since it is not able to build some modules (because now Kores requires Java 16 at least), we are not officially using it.

