Kores provides 5 (6 in recent versions with Record) different kinds of class declaration: ClassDeclaration InterfaceDeclaration EnumDeclaration AnonymousClassDeclaration AnnotationDeclaration Let's get started with the class declaration: val personDeclaration = ClassDeclaration.Builder.builder() .name("Person") .build() Now we are going to use the Kores-SourceWriter to render this declaration into a Java class: val sourceGenerator = PlainSourceGenerator()
val source = sourceGenerator.process(personDeclaration)
println(source) The result would be: public class Person {
} By default, Kores uses public modifier for all types, to generate a package-private class you need to use PACKAGE_PRIVATE modifier: val personDeclaration = ClassDeclaration.Builder.builder() .modifiers(KoresModifier.PACKAGE_PRIVATE) .name("Person") .build() Which renders to: class Person {
}

