Adding new fields are very simple: val nameFieldDeclaration = FieldDeclaration.Builder.builder() .modifiers(KoresModifier.PRIVATE, KoresModifier.FINAL) .type(Types.STRING) .name("name") .build() val personDeclaration = ClassDeclaration.Builder.builder() .name("Person") .fields(nameFieldDeclaration) .build() val sourceGenerator = PlainSourceGenerator()
val source = sourceGenerator.process(personDeclaration) println(source) Result: public class Person { private final String name;
}

