Now we need to have a constructor in order to define our field (which is final): val nameFieldDeclaration = FieldDeclaration.Builder.builder() .modifiers(KoresModifier.PRIVATE, KoresModifier.FINAL) .type(Types.STRING) .name("name") .build() val constructorDeclaration = ConstructorDeclaration.Builder.builder() .build() val personDeclaration = ClassDeclaration.Builder.builder() .name("Person") .fields(nameFieldDeclaration) .constructors(constructorDeclaration) .build() val sourceGenerator = PlainSourceGenerator()
val source = sourceGenerator.process(personDeclaration) println(source) Result: public class Person { private final String name; public Person() { }
}

