Now that we have a field and a constructor, we need to define the field value to be the same as the constructor parameter value, first we need the parameter, so let's modify our constructor declaration: val constructorDeclaration = ConstructorDeclaration.Builder.builder() .parameters( KoresParameter.Builder.builder() .type(Types.STRING) .name("name") .build() ) .build() And then provide a body for the constructor with the instructions which reads the parameter and sets the field: val constructorDeclaration = ConstructorDeclaration.Builder.builder() .parameters( KoresParameter.Builder.builder() .type(Types.STRING) .name("name") .build() ) .body(MutableInstructions.create(listOf( setThisFieldValue(Types.STRING, "name", accessVariable(Types.STRING, "name")) ))) .build() The full code is: val nameFieldDeclaration = FieldDeclaration.Builder.builder() .modifiers(KoresModifier.PRIVATE, KoresModifier.FINAL) .type(Types.STRING) .name("name") .build() val constructorDeclaration = ConstructorDeclaration.Builder.builder() .parameters( KoresParameter.Builder.builder() .type(Types.STRING) .name("name") .build() ) .body(MutableInstructions.create(listOf( setThisFieldValue(Types.STRING, "name", accessVariable(Types.STRING, "name")) ))) .build() val personDeclaration = ClassDeclaration.Builder.builder() .name("Person") .fields(nameFieldDeclaration) .constructors(constructorDeclaration) .build() val sourceGenerator = PlainSourceGenerator()
val source = sourceGenerator.process(personDeclaration) println(source) And the result: public class Person { private final String name; public Person(String name) { this.name = name; }
}
